The Clash - Police on My Back [Hell W10 soundtrack promo].mp4



HQ music video excerpt taken from the &quot;Hell W10&quot; movie soundtrack. 

&quot;Police On My Back&quot; is a song from Sandinista!, the fourth studio album by the English punk rock band The Clash. It was released on 12 December 1980 as a triple album containing 36 tracks, with 6 songs on each side. Anticipating the &quot;world music&quot; trend of the 1980s, it features reggae, jazz, mock gospel, rockabilly, folk, dub, rhythm and blues, calypso, and rap.

Hell W10 - written and directed by Joe Strummer, is a silent movie filmed in the summer of 1983 in black and white.

